          <Route path="/insert" element={<InsertEvent />} />
          <Route path="/verify" element={<VerifyEvent />} />
          <Route path="/leaderboard" element={<Leaderboard />} />
          <Route path="/admin-login" element={<AdminLogin />} />
          <Route path="/admin" element={<AdminPanel />} />
          <Routes>
        </Routes>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
